import React, { useState } from "react";

function ZipSearch() {
  const [zipCode, setZipCode] = useState(0);

  const handleChange = event => {
    setZipCode(event.target.value);
  };

  return (
    <form>
      <label>Zipcode</label>
    </form>
  );
}

export default ZipSearch;
